definition.precondition:
- the satellite power must be available;
- the instrument must be on board of the satellite;
- the instrument must be powered off.

definition.postcondition:
- the satellite power is no longer available;
- the instrument is powered on;
- the instrument is uncalibrated.

definition.precondition:
- the satellite must be pointing to one of the instruments calibration targets.
- the instrument must be on board of the satellite;
- the instrument must be powered on;
- the instrument must be uncalibrated.

- the satellite must be pointing to the direction;
- there must enough data capacity on the satellite to save the image, accordingly to the direction and to the picture mode;
- the instrument must on board of the satellite;
- the instrument must be powered on;
- the instrument must be calibrated;
- the instrument must support the picture mode.

definition.postcondition:
- the satellite has the image;
- the satellite data capacity decreases;
- the satellite stored data increases.

definition.invariants:
- the satellite power availability remains the same;
- the satellite keeps pointing to the calibration target;
- the instruments on board aren't affected.
